Ma premiere fois (Kendo, Marc Dorcel / DvdRip / 2014)

Zoe (Vanda Lust) is a young student. At 19, she has not yet experienced the thrill of a sexual relationship with a boy... But things could change during the weekend she will spend at the country house that belongs to the handsome Michael.However, there is a problem: Zoe`s mother (Angel Wicky), a hot 40-something woman with an insatiable sexual appetite, has also decided to seduce Michael. Things look complicated for this weekend in the country, especially as adulterous work colleagues and swinger neighbors are also invited. Will Zoe, the pretty virgin, manage to seduce Michael by being even more of a bitch than her own mother? Whatever happens, it`s the sexual goal she has set herself..

Vanda Lust, Angel Wicky, Barra Brass, Cage, Choky Ice, David Perry, George UHL, Kristof Cale, Lilith Lee, Mike Angelo, Satin Bloom

Anal, DP, Feature

